package bean;

public class Vacxin {
	private int MaVacxin;
	private String TenVacxin;
	private int SoMui;
	private String MoTa;
	private int GiaVacxin;
	private String TenHang;
	public Vacxin(int maVacxin, String tenVacxin, int soMui, String moTa, int giaVacxin, String tenHang) {
		super();
		MaVacxin = maVacxin;
		TenVacxin = tenVacxin;
		SoMui = soMui;
		MoTa = moTa;
		GiaVacxin = giaVacxin;
		TenHang = tenHang;
	}
	public Vacxin() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getMaVacxin() {
		return MaVacxin;
	}
	public void setMaVacxin(int maVacxin) {
		MaVacxin = maVacxin;
	}
	public String getTenVacxin() {
		return TenVacxin;
	}
	public void setTenVacxin(String tenVacxin) {
		TenVacxin = tenVacxin;
	}
	public int getSoMui() {
		return SoMui;
	}
	public void setSoMui(int soMui) {
		SoMui = soMui;
	}
	public String getMoTa() {
		return MoTa;
	}
	public void setMoTa(String moTa) {
		MoTa = moTa;
	}
	public int getGiaVacxin() {
		return GiaVacxin;
	}
	public void setGiaVacxin(int giaVacxin) {
		GiaVacxin = giaVacxin;
	}
	public String getTenHang() {
		return TenHang;
	}
	public void setTenHang(String tenHang) {
		TenHang = tenHang;
	}
	
	
}
